import React from 'react';
import AppLayout from '../components/AppLayout';
import Image from 'next/image';

const Home = () => {
    return (
        <AppLayout>
            <Image src="/images/PocketVaccineLogo.png" alt="Logo" layout="fill"/>
            <div>Hello Next!</div>
        </AppLayout>
    );
}

export default Home;
